import "./App.css";
import Homepage from "./homepage";
import Detail from "./detail";
import Booking from "./booking";
import Booking1 from "./booking1";
import Booking2 from "./booking2";
import Succes from "./succes";
import { Routes, Route } from "react-router-dom";

function App() {
  return (
    <div className="App">
      <Routes>
        <Route path="/" element={<Homepage />} />
        <Route path="/detail" element={<Detail />} />
        <Route path="/booking" element={<Booking />} />
        <Route path="/booking/booking-Ovo" element={<BookingOvo />} />
        <Route path="/booking/booking-Gopay" element={<BookingGopay />} />
        <Route path="/booking/booking-Toko" element={<BookingToko />} />
        <Route path="/booking/booking-Bank" element={<BookingBank />} />
      </Routes>
    </div>
  );
}

export default App;
